import { useState } from "react";
import axios from 'axios'
import Link from 'react'
function Dashboard(){
    const[dataRetrive,setdataRetrive]=useState([])

    const retriveprocess=()=>{
        axios.post('http://localhost:5001/RetriveData')
        .then((res)=>{
           setdataRetrive(res.data.result)
        })
        .catch((error)=>{
            console.log(error);
            
        })
    }

    return(
        <div>
            <center>
                <h1 className="bg-blue-500 text-white p-8 text-center text-xl">Logined Userlist</h1>
                <button onClick={retriveprocess}>Retrive Data</button>
                <link to='/Loginpage' ><button>Login</button></link>
                {
                    dataRetrive.length>0 && 
                    <>
                    <table>
                        <thead>
                            <tr>
                                {
                                    Object.keys(dataRetrive[0]).map((key)=>(
                                        <th key={key}>{key.toUpperCase()}</th>
                                    ))
                                }
                            </tr>
                        </thead>
                        <tbody>
                                {dataRetrive.map((row,index)=>(
                                    <tr key={index}>
                                        {Object.values(row).map((values,i)=>(
                                            <td key={i}>{values}</td>
                                        ))}
                                    </tr>
                                ))}
                        </tbody>
                    </table>
                    </>
                }
            </center>
        </div>
    )
}
export default Dashboard
